(rawData, categoryTypeFirst, categoryTypeSecond, categoryTypeThird) => {
  let timeStamps = rawData.data.map(item => {
    return {
      'label': item.date + '.' + item.time
    };
  });
  let filtered_content_data = rawData.data.map(item => {
    return item.counts.filter(subItem => subItem.category.type === categoryTypeFirst || subItem.category.type === categoryTypeSecond || subItem.category.type === categoryTypeThird);
  });
  console.log('filtered_content_data =', filtered_content_data);
  let all_types = [];
  filtered_content_data.forEach(item => item.forEach(subItem => !all_types.includes(subItem.category.label) ? all_types.push(subItem.category.label) : 'already exists, not adding!'));
  let superSeries = [];
  function contentChecker(dataObj, typeToFilter) {
    let checkerResult = dataObj.counts.filter(countsItem => countsItem.category.label.includes(typeToFilter));
    let finalResult = checkerResult.length ? {
      "value": checkerResult[0].requests
    } : {
      "value": 0
    };
    return finalResult;
  }
  all_types.forEach(typeItem => {
    superSeries.push({
      "seriesname": typeItem,
      "data": rawData.data.map(dataObj => {
        return contentChecker(dataObj, typeItem);
      })
    });
  });
  return {
    "timeStamps": timeStamps,
    "dataSeries": superSeries
  };
}

